import {ContainerRanking} from '../style/style'
import axios from 'axios'
import { useEffect } from 'react'


let retorno = null
async function RankingPlayers () {
    retorno = await axios.get('http://localhost:3333/busca')
    console.log(retorno)
}

function Ranking () {
    useEffect(() => {
        
       RankingPlayers()
    },[])
    return (
        <ContainerRanking>
            {
                retorno.data.map((element,i) => {
                    return (
                        <div>
                            Nome: {element.name}
                        </div>
                    )
                })
            }
        </ContainerRanking>
    )
}


export default Ranking
